import React from 'react';
import logo from '../assets/logo.png';

const Footer = () => {
  return (
    <footer className="py-8 bg-white shadow">
      <div className="container mx-auto px-6 text-center">
        <a href="#" className="text-xl font-bold text-gray-800">Replaice.ai</a>
        
          <img src={logo} alt="Replaice Logo" className="flex items-center space-x-2" />
          
       
        <p className="mt-2 text-sm text-gray-600">Revolutionizing work with AI-powered solutions.</p>
        <div className="mt-4 flex justify-center space-x-4">
          <a href="#privacy" className="text-gray-600 hover:text-gray-900">Privacy Policy</a>
          <a href="#terms" className="text-gray-600 hover:text-gray-900">Terms of Service</a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
